    'terms.TermsOfUse': '\u0634\u0631\u0648\u0637 \u0627\u0644\u0627\u0633\u062A\u062E\u062F\u0627\u0645',
    'about.AboutBrand': 'About OLX',
    'about.AboutText1': 'OLXis the world\u2019s leading classifieds platform focused in emerging markets, both mobile and online',
    'about.AboutText2': 'OLX operates globally and has presence in more than 40 countries',
    'about.about_Body': '<p>OLX \u0647\u0648 \u0627\u0644\u062C\u064A\u0644 \u0627\u0644\u0645\u0642\u0628\u0644 \u0645\u0646 \u0645\u062C\u0627\u0646\u064A\u0647 \u0639\u0644\u0649 \u0627\u0644\u0627\u0646\u062A\u0631\u0646\u062A \u0627\u0639\u0644\u0627\u0646\u0627\u062A \u0645\u0628\u0648\u0628\u0647.<br /><br />OLX \u064A\u0648\u0641\u0631 \u062D\u0644 \u0628\u0633\u064A\u0637 \u0644\u0627\u0644\u062A\u0639\u0642\u064A\u062F\u0627\u062A \u0627\u0644\u062A\u064A \u064A\u0646\u0637\u0648\u064A \u0639\u0644\u064A\u0647\u0627 \u0627\u0644\u0628\u064A\u0639 \u060C \u0627\u0644\u0634\u0631\u0627\u0621 \u060C \u0648\u0627\u0644\u062A\u062C\u0627\u0631\u0629 \u060C \u0645\u0646\u0627\u0642\u0634\u0629 \u060C \u0648\u062A\u0646\u0638\u064A\u0645 \u060C \u0648\u0627\u062C\u062A\u0645\u0627\u0639 \u0627\u0644\u0646\u0627\u0633 \u0642\u0631\u0628 \u0644\u0643\u0645 \u060C \u0627\u064A\u0646\u0645\u0627 \u0643\u0646\u062A \u0642\u062F \u064A\u0642\u064A\u0645.<br /><br />\u0639\u0644\u0649 OLX \u064A\u0645\u0643\u0646\u0643 :<br /><ul><li>\u0627\u0644\u063A\u0646\u064A\u0647 \u0628\u0633\u0647\u0648\u0644\u0629 \u062A\u0635\u0645\u064A\u0645 \u0627\u0644\u0642\u0648\u0627\u0626\u0645 \u0645\u0639 \u0627\u0644\u0635\u0648\u0631 \u0627\u0644\u0645\u0644\u0648\u0646\u0629 \u0648\u0627\u0644\u0641\u064A\u062F\u064A\u0648</li><li>\u0627\u0644\u062A\u062D\u0643\u0645 \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0643 \u0628\u064A\u0639 \u060C \u0634\u0631\u0627\u0621 \u060C \u0648\u0627\u0644\u0627\u0646\u0634\u0637\u0647 \u0627\u0644\u0645\u062C\u062A\u0645\u0639\u064A\u0647 \u0641\u064A \u0628\u0644\u0627\u062F\u064AOLX</li><li>\u0639\u0631\u0636 \u0642\u0648\u0627\u0621\u0645\u0643 \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0643 \u0639\u0644\u0649 \u0627\u0642\u0627\u0645\u0629 \u0627\u0644\u0634\u0628\u0643\u0627\u062A \u0627\u0644\u0627\u062C\u062A\u0645\u0627\u0639\u064A\u0629 \u0644\u0645\u062D\u0629(Facebook, Myspace, ...)</li><li>\u0627\u0644\u0648\u0635\u0648\u0644 \u0627\u0644\u0649 \u0627\u0644\u0645\u0648\u0642\u0639 \u0645\u0646 \u0647\u0627\u062A\u0641\u0643 \u0627\u0644\u062C\u0648\u0627\u0644</li><li>\u0648\u0646\u0638\u0631\u0627 OLX \u0641\u064A \u0627\u0644\u0644\u063A\u0629 \u0627\u0644\u0645\u062D\u0644\u064A\u0629 \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0643</li></ul><br />OLX \u064A\u0633\u062A\u062E\u062F\u0645 \u0641\u064A \u0627\u0643\u062B\u0631 \u0645\u0646 <<QTY_COUNTRIES>> \u0628\u0644\u062F\u0627 \u0641\u064A <<QTY_LANGUAGES>> \u0644\u063A\u0629. \u0648\u0643\u0627\u0646\u062A \u0627\u0644\u0634\u0631\u0643\u0629 \u0627\u0644\u062A\u064A \u062A\u0623\u0633\u0633\u062A \u0641\u064A \u0622\u0630\u0627\u0631 / \u0645\u0627\u0631\u0633 2006 \u0648\u0627\u0644\u0642\u0637\u0627\u0639 \u0627\u0644\u062E\u0627\u0635 \u0648\u0627\u0644\u062A\u064A \u0639\u0642\u062F\u062A.</p>',
