    'featured_listings.AdditionalTermsForFeaturedAds': 'Additional Terms for Featured Ads',
    'featured_listings.AdditionalTermsForFeaturedAds_content': 'These additional terms, in addition to the Website\u2019s <<LINK_TERMS_USE>>Terms of Use<</LINK_TERMS_USE>>, cover usage of Featured Ads:<br /><ul><li>As proof of payment for a Featured Ad, OLX will only issue an \u201COrder Confirmation\u201D that you will see at the end of the payment process and an email confirmation.</li><li>If for some reason, whether technical or of any nature, your ad is not showing in the \u201CFeatured Ad\u201D area, OLX\u2019s only obligation is to place your ad in the \u201CFeatured Ad\u201D area as soon as practicable for us to do so.</li><li>A third party service provider provides our billing solution.</li><li>At OLX\u2019s sole discretion, any Ads which are offensive, pornographic, spam (including duplicate listings), potential scams or may infringe any copyrights will not be featured and the payment will not be reimbursed/refunded.</li><li>THIS FEATURED AD SERVICE IS PROVIDED ON AN "AS IS" OR "AS AVAILABLE" BASIS, WITHOUT ANY WARRANTIES OF ANY KIND TO THE FULLEST EXTENT PERMITTED BY LAW.  OLX MAKES NO WARRANTIES OR REPRESENTATIONS ABOUT AND ASSUMES NO LIABILITY OR RESPONSIBILITY FOR THE ACCURACY OR COMPLETENESS OF THE CONTENT LISTED IN THE FEATURED AD SERVICE.',
    'featured_listings.Benefits': 'Benefits',
    'featured_listings.Benefits_content': 'You get better placement and thus drive lots of visits to your listings. The images below show the two types of Featured Listings available.',
    'featured_listings.Feature': 'Feature',
    'featured_listings.FeaturedListings_Content': 'This service allows you to put your ad in an exceptional place for a specific period of time giving you much more visibility and guaranteeing many more replies.',
    'featured_listings.FeatureMyListing': 'Feature my Listing',
    'featured_listings.FeatureYourListingForUp20TimesVisibility': '<<LINK_FEATURED_LISTINGS>>Feature your listing<</LINK_FEATURED_LISTINGS>> for up to 20 times the visibility!',
    'featured_listings.HowDoesItWork': 'How does it work?',
    'featured_listings.HowDoesItWork_New': 'For Top of the Listings and Search Results Featured Ads, the Featured Ads are shown in the applicable subcategory and rotate randomly amongst all the Featured Ads for that subcategory and location. In all instances, the selection of the Featured Ad is randomly generated to allow all Featured Ads purchasers to have the same chance to appear on the Website. This is why it\'s possible that your ad will not always show up in the applicable Featured Ads section.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'How do I buy a Featured Listing?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'You can buy a Featured Ad from the last step of the posting process which confirms that your ad has been published or from My OLX. The process is straightforward.You select how many weeks you want to feature your ad for. You are then taken to the payment page with a variety of payment options. After making the payment, you will receive confirmation that your ad is available with the chosen amount of time. If your ad complies with the OLX terms of use, you will receive an email confirmation. Please note there are absolutely no refunds once you have purchased a Featured Ad. All sales of Featured Ads are final.',
    'featured_listings.HowDoIFeatureMyAd': 'How do I feature my ad?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings': 'How long will my listing appear in the Featured Listings section?',
